import React from 'react';

const VoituresData = () => {

    const voituresData = [
        { id: 1, image: "./image/voiture_ford_1" },
        { id: 2, image: "./image/voiture_ford_1" }
    ];

    return (
        <div>
            {voituresData.image}
        </div>
    );
};

export default VoituresData;
